import React from 'react';
import { Component } from 'react';

class Welcome extends Component {

	render() {

		return (
			<div>
				<h1>Welcome {this.props.name} and {this.props.name2}</h1>
				<h2>{this.props.children}</h2>
			</div>);
	}
}

export default Welcome;
